import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import './VerticalNavBar.css';

function VerticalNavBar({
    onFilterChange,
    toggleCompanyList,
    showCompanyList,
    schoolFilter,
    yearFilter,
    typeFilter,
    setSchoolFilter,
    setYearFilter,
    setTypeFilter,
}) {
    const [tooltip, setTooltip] = useState('');
    const [tooltipPosition, setTooltipPosition] = useState({ top: 0, left: 0 });
    const [schools, setSchools] = useState([]);
    const [types, setTypes] = useState([]);
    const [years, setYears] = useState([]);

    // Fetch schools, types, and years from the backend
    useEffect(() => {
        const fetchFilters = async() => {
            try {
                // Make API call to fetch schools, types, and years
                const response = await axios.get('/api/filters'); // Adjust API endpoint as needed
                setSchools(response.data.schools); // Assuming API returns an object { schools, types, years }
                setTypes(response.data.types);
                setYears(response.data.years);
            } catch (error) {
                console.error('Error fetching filters:', error);
            }
        };

        fetchFilters();
    }, []);

    const handleMouseEnter = (text, event) => {
        setTooltip(text);
        const { top, left, height } = event.currentTarget.getBoundingClientRect();
        setTooltipPosition({ top: top + height + window.scrollY, left });
    };

    const handleMouseLeave = () => setTooltip('');

    const handleFilterChange = (filterType, value) => {
        if (filterType === 'School') {
            setSchoolFilter(value);
        } else if (filterType === 'Year') {
            setYearFilter(value);
        } else if (filterType === 'Type') {
            setTypeFilter(value);
        }
    };

    return ( <
        div className = "vertical-nav" >
        <
        button onClick = {
            () => onFilterChange('All Students') } > All Students < /button> <
        button onClick = {
            () => onFilterChange('Placed') } > Placed Students < /button> <
        button onClick = {
            () => onFilterChange('Not placed') } > Not Placed Students < /button>

        <
        select value = { schoolFilter || '' }
        onChange = {
            (e) => handleFilterChange('School', e.target.value) }
        onMouseEnter = {
            (e) => handleMouseEnter('Filter by school.', e) }
        onMouseLeave = { handleMouseLeave } >
        <
        option value = "" > Select School < /option> {
            schools.length > 0 ? (
                schools.map((school) => ( <
                    option key = { school }
                    value = { school } > { school } <
                    /option>
                ))
            ) : ( <
                option value = "" > Loading schools... < /option>
            )
        } <
        /select>

        <
        select value = { yearFilter || '' }
        onChange = {
            (e) => handleFilterChange('Year', e.target.value) }
        onMouseEnter = {
            (e) => handleMouseEnter('Filter by year.', e) }
        onMouseLeave = { handleMouseLeave } >
        <
        option value = "" > Select Year < /option> {
            years.length > 0 ? (
                years.map((year) => ( <
                    option key = { year }
                    value = { year } >
                    Year { year } <
                    /option>
                ))
            ) : ( <
                option value = "" > Loading years... < /option>
            )
        } <
        /select>

        <
        select value = { typeFilter || '' }
        onChange = {
            (e) => handleFilterChange('Type', e.target.value) }
        onMouseEnter = {
            (e) => handleMouseEnter('Filter by type of offer or internship.', e) }
        onMouseLeave = { handleMouseLeave } >
        <
        option value = "" > Select Type < /option> {
            types.length > 0 ? (
                types.map((type) => ( <
                    option key = { type }
                    value = { type } > { type } <
                    /option>
                ))
            ) : ( <
                option value = "" > Loading types... < /option>
            )
        } <
        /select>

        <
        button onClick = { toggleCompanyList } > { showCompanyList ? 'Hide Companies' : 'Companies Visited' } <
        /button>

        <
        Link to = "/job-notifications"
        className = "nav-link" >
        Job Notifications <
        /Link>

        {
            tooltip && ( <
                div className = "tooltip"
                style = {
                    { top: tooltipPosition.top, left: tooltipPosition.left } } >
                { tooltip } <
                /div>
            )
        } <
        /div>
    );
}

export default VerticalNavBar;
